import React from "react";
import { logo } from "../../assets/images";
import "./Header.style.css";

function Header() {
  return (
    <nav className="navWrapper">
      <div>
        <img src={logo} alt="logo" />
        <p>Features</p>
        <p>Pricing</p>
        <p>Resources</p>
      </div>
      <div>sup</div>
    </nav>
  );
}

export default Header;
